import React from 'react';
import '../styles/global.css';

const CreateDiaryPage: React.FC = () => {
  return (
    <div className="container" style={{
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center',
      minHeight: '100vh',
      width: '100%',
      background: 'black',
      color: 'white',
      padding: '0 2rem',
      position: 'relative',
    }}>
      <button
        style={{
          position: 'absolute',
          left: '2rem',
          top: '2rem',
          padding: '0.8rem 1.5rem',
          background: 'transparent',
          color: 'white',
          border: '2px solid white',
          borderRadius: '10px',
          fontSize: '1rem',
          cursor: 'pointer',
          transition: 'all 0.3s ease',
          boxShadow: '0 0 10px rgba(255, 255, 255, 0.3)',
          fontFamily: "'SF Pro Display', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif",
        }}
        onMouseOver={(e) => {
          e.currentTarget.style.boxShadow = '0 0 20px rgba(255, 255, 255, 0.5)';
          e.currentTarget.style.transform = 'scale(1.05)';
        }}
        onMouseOut={(e) => {
          e.currentTarget.style.boxShadow = '0 0 10px rgba(255, 255, 255, 0.3)';
          e.currentTarget.style.transform = 'scale(1)';
        }}
      >
        Upload Photo
      </button>
      <h1 style={{
        fontSize: '3.5rem',
        fontWeight: 'bold',
        marginTop: '2rem',
        marginBottom: '2rem',
        fontFamily: "'SF Pro Display', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif",
        display: 'flex',
        gap: '15px',
      }}>
        <span style={{
          color: '#87CEEB',
          textShadow: `
            0 0 1px #87CEEB,
            0 0 2px #87CEEB,
            0 0 21px #87CEEB,
            0 0 30px #00BFFF,
            0 0 50px #00BFFF
          `,
        }}>
          Story
        </span>
        <span style={{
          color: 'white',
          textShadow: `
            0 0 1px #fff,
            0 0 2px #fff,
            0 0 21px #fff,
            0 0 30px #fff,
            0 0 50px #fff
          `,
        }}>
          Dashboard
        </span>
      </h1>
      <div style={{
        width: '90%',
        minHeight: '70vh',
        background: 'black',
        borderRadius: '20px',
        padding: '2rem',
        boxShadow: `
          0 0 2px #fff,
          0 0 4px #fff,
          0 0 8px #fff,
          0 0 16px #fff,
          0 0 32px #fff
        `,
        border: '2px solid white',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        marginBottom: '2rem',
      }}>
        {/* Story posts will be added here */}
      </div>
    </div>
  );
};

export default CreateDiaryPage;
